var React = require('react');

class Home extends React.Component {
    render() {

        let getTax = this.props.tax;
        let tax;
        console.log(getTax);

       // If tax is undefined, don't show tax
        if ( getTax !== undefined) {
            tax = getTax;
        } else {
            tax = "There is no tax defined for this item."
        }

        return (
            <html>
                <body>
                    <div>
                        <h3>Product Title: </h3>
                        <p>{ this.props.title }!</p>

                        <h3>By: </h3>
                        <p>{ this.props.name }</p>

                        <h3>Stock Availability: </h3>
                        <p>{ this.props.availability }</p>

                        <h3>Tax: </h3>
                        <p>{tax}</p>
                    </div>
                </body>
            </html>
            );
    }
}

module.exports = Home;

